import React from "react";


// Styled Components
import { FiveList } from "../../styled/posts/fiveList";

export default function FiveListComponent() {
    return (
        <FiveList>
          <ol>
                <li>Platz 1</li>
                <li>Platz 2</li>
                <li>Platz 3</li>
                <li>Platz 6</li>
                <li>Platz 5</li>
            </ol>
        </FiveList>
    );
    }
